    - pattern_library
    - Member[views].Member[IndexView]
  - - Django.Views.View~Subclass
    - pattern_library
    - Member[views].Member[RenderPatternView]
  - - Django.Views.View~Subclass
    - pattern_library
    - Member[views].Member[TemplateView]
